import React from "react"; // var React = require("react");
import ReactDOM from 'react-dom'; // var ReactDOM = require("react-dom");

function Card(props){
  return(
    <div className="cards">
      <div className="card">
        <img src={props.imgsrc} alt="tilepic" className="card_image"></img>
        <div className="card_info">
          <span className="card-category">{props.sname}</span>
          <h3 className="card_title">{props.title}</h3>
          <a href={props.link} target="_blank">
            <button>Watch Now</button>
          </a>
        </div>
      </div>
    </div>
  )
};

ReactDOM.render(
  <>
    <Card imgsrc="https://mir-s3-cdn-cf.behance.net/project_modules/fs/8a6a68144592045.628efcd3e77b5.jpg" title="" link="https://www.netflix.com/pk/title/80057281" title="Stranger Things"/>
    <Card imgsrc="https://i.pinimg.com/474x/a4/23/0f/a4230f6c4e62f8a5928d7e48dfc0c823.jpg" name="" link="https://www.netflix.com/pk/title/80100172" title="Dark"/>
    <Card imgsrc="https://www.themoviedb.org/t/p/original/8jUlLqqPVkO7tRtZsGYjWteJJeR.jpg" title="" link="https://www.netflix.com/pk/title/81237994" title="All of Us Are Dead"/>
    <Card imgsrc="https://www.themoviedb.org/t/p/original/uw6rLtSGDtXkFU3zPcjR3jx779F.jpg" title="" link="https://www.netflix.com/pk/title/81240831" title="Alive"/>
  </>, document.getElementById('root')
